import Navigation from "./components/Navigation";
import endpoint from "./endpoint/SpringBootLog";

import { useState, useEffect } from "react";

import './App.css';

function App() {
    localStorage.setItem("token", "token_116048405164800000797")

    const [teste, setTeste] = useState([]);

    function tratarDados(data){
        //data += "   ";
        let i;
        let linha = "";
        let springBoot = [];
        // for(i = 0; i < data.length; i++){
        //     aux += data[i]
        //     if(data[i + 1] === "a" && data[i + 2] === "t" && data[i + 3] === " "){
        //         springBoot.push(aux);
        //         aux = "";
        //     }
        // }
        // let aux = data.indexOf("at ");
        // console.log(data.slice(0, aux));
        // console.log(data);


        let first = 0;
        let last = data.indexOf("at ");
        while(last !== -1){
            springBoot.push("at " + data.slice(first, last));
            first = last + 2;
            last = data.indexOf("at ", first);
        }
        setTeste(springBoot)
    }

    useEffect(() => {
        endpoint.springbootlog()
        .then(data => {
            console.log(data);
            tratarDados(data[1]);
        })
        .catch(error => console.log(error));
    }, [])

    return ( 
        <div className="App" >
            <Navigation />
            {teste.map((linha, index) => {
                return (
                    <div key={index}>
                        <p>{linha}</p>
                    </div>
                );
            })}
        </div>
    );
}

export default App;
